		this.buttonhintecht.visible = false;
		this.hintveld.hinttxt.text = "";
		this.hintveld.visible = false;
		this.buttonhintecht.cursor="pointer";
		this.hintveld.cursor="pointer";
		this.buttonhintecht.addEventListener("click", hintbuttonClickEvent);
		this.hintveld.addEventListener("click", hintveldClickEvent);
		this.quitscherm.visible = false;
		this.quitbutton.visible=true;
		this.quit.visible = true;
		this.quitbutton.cursor="pointer";
		this.quitbutton.addEventListener("click", quitbutton15ClickEvent);
		if (this.introskipped) {
			if (this.lvl==this.eerstegesplevel && this.musicon) this.mysong=createjs.Sound.play ("SongYellowMain",null,0,0,-1,1);
		} else {
			if ((this.eerstegesplevel+1)==this.lvl && this.musicon) 
				this.mysong=createjs.Sound.play ("SongYellowMain",null,0,0,-1,1);
		}
		
